Autowiring multiple repositories into a single DAO in Spring - bad practice?<p>Let's say I have the following Spring Mongo repositories. ObjectOne, ObjectTwo and ObjectThree represent documents stored in separate collections within the same database</p>

<pre><code>public interface RepositoryOne extends MongoRepository&lt;ObjectOne, String&gt; {
}

public interface RepositoryTwo extends MongoRepository&lt;ObjectTwo, String&gt; {
}

public interface RepositoryThree extends MongoRepository&lt;ObjectThree, String&gt; {
}
</code></pre>

<p>And then a single DAO class</p>

<pre><code>public class ExampleDAO {
    @Autowired
    private RepositoryOne repositoryOne;

    @Autowired
    private RepositoryTwo repositoryTwo;

    @Autowired
    private RepositoryThree repositoryThree;

    //Various methods performing operations with repositoryOne
    //Various methods performing operations with repositoryTwo
    //Various methods performing operations with repositoryThree
}
</code></pre>

<p>Is it considered bad practice to be autowiring multiple repositories into a single DAO like above? It feels like the class may be doing too much and ideally I should have a single repository to maintain single responsibility. If it is bad practice, would a separate DAO for each repository be the way to go, or is there a Spring magic way to create a single repository that I can use to call a more specific repository?</p>

