How to group nested fields in mongodb aggregation<p>My document is a little complicated, it is like:</p>

<pre><code>        {
            '_id': 1,
            'words':
                {
                    'a': 
                        {
                        'positions': [1,2,3],
                        'count':3,
                    },
                    'and':
                        {
                            'positions': [4, 5],
                            'count': 2,
                        }
            }
        }
</code></pre>

<p>I have many ducuments that contains very same words, I want aggregate all the fields in <code>words</code>. To give it me like:</p>

<pre><code>                {
                    'a': 5 #a's sum count

                    'and': 6 #and's sum count
                }
</code></pre>

<p>I read this article, <a href="https://stackoverflow.com/questions/29879825/mongodb-group-composite-key-with-nested-fields">MongoDB - group composite key with nested fields</a>, but unluckily, the structure is different, what they do is group the array field, not the nested field.</p>

<p>Any advice? Hope your answer and help, thanks in advance.</p>

