Mongoose.js query criteria not working with boolean and object id search<p>I'm seeing some odd behavior with Mongoose 4.11.</p>

<p>The issue is that I'm getting documents returned that I don't think should be. See below for specifics after the code.</p>

<p>(Sorry for the long code snippets... it's tough when talking about DBs cause you need model, data, query, and results, right?)</p>

<p>Here's the model:</p>

<pre><code>const UserSchema = new Schema({
firstName: {
    type: String
},
lastName: {
    type: String
}
groups: [
    {
        name: String,
        members: [
            {
               user: {
                   type: Schema.Types.ObjectId, ref: 'User'
               },
                hasAccepted: {
                    type: Boolean,
                    default: false
                }
            }
        ]
    }
]
});
</code></pre>

<p>the query:</p>

<pre><code>const query = {
    'groups.members.user':aUserID, // '5a712ca2db684000102e51b7' in this case
    'groups.members.hasAccepted':'false'
};

const fields = 'firstName lastName groups.name';

User.find(query, fields, function(err, result){
    res.send(result);
});
</code></pre>

<p>and the data set (leaving out unnecessary name and id fields):</p>

<pre><code>[
{
    "groups": [
        {
            "name": "Test Group",
            "members": [
                {
                    "user": {
                        "$oid": "5a712ca2db684000102e51b7"
                    },
                    "hasAccepted": false
                },
                {
                    "user": {
                        "$oid": "5a7141fb5b19bb0011e27658"
                    },
                    "hasAccepted": false
                }
            ]
        }
    ]
},
{
    "groups": [
        {
            "name": "Test Group 2",

            "members": [
                {
                    "user": {
                        "$oid": "5a712ca2db684000102e51b7"
                    },
                    "hasAccepted": true
                },
                {
                    "user": {
                        "$oid": "5a7141fb5b19bb0011e27658"
                    },
                    "hasAccepted": false
                }
            ]
        }
    ]
}
]
</code></pre>

<p>I would expect to get back only the Test Group, and not Test Group 2 because my query is looking only for groups with the user id matched and hasAccepted property false.</p>

<p>However, I'm getting both groups returned.</p>

<p>I've tried a number of thing to confirm that the query is setup correctly otherwise.</p>

<p>For example if I remove the user id I'm looking for from Test Group 2 and  change the query to:</p>

<pre><code>const query = {
    'groups.members.user':aUserID, // '5a712ca2db684000102e51b7' in this case
    'groups.name':'Test Group 2'
};
</code></pre>

<p>I get nothing returned (this confirms it's not an "OR" operator in play)</p>

<p>If I change the query to:</p>

<pre><code>const query = {
    'groups.members.hasAccepted':true
};
</code></pre>

<p>I get only Test Group 2 returned (this confirms my hasAccepted criteria is working)</p>

<p>It's when I add both together that it stops making sense.</p>

<p>(wish I could vote up anyone who reads this far :) )</p>

<p>Anyone have any ideas as to what could be going on here?</p>

<p>Thanks.</p>

